			Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}],
			Stubs :> {
				AnalyzeDNASequencing[
					Object[Data, DNASequencing, "Test Object 1 (AnalyzeDNASequencing Test)" <> $SessionUUID]
				] = stripAppendReplaceKeyHeads@AnalyzeDNASequencing[
