(* Helper function to delete remnants of uploaded test data *)
deleteTestDNAData[]:=Module[
	{testObjList, existingObjs},
		testObjList = {
			Object[Data, DNASequencing, "Test Object 1 (AnalyzeDNASequencing Test)" <> $SessionUUID],
			Object[Data, DNASequencing, "Test Object 2 (AnalyzeDNASequencing Test)" <> $SessionUUID],
			Object[Protocol, DNASequencing, "Test Protocol 1 (AnalyzeDNASequencing Test)" <> $SessionUUID],
			Object[Data, DNASequencing, "Test pGEM Sequence (AnalyzeDNASequencing Test)" <> $SessionUUID],
			Object[Data, DNASequencing, "Test Object 3 (AnalyzeDNASequencing Test)" <> $SessionUUID]
		};
		(* delete preexisting object in the database *)
		existingObjs = PickList[testObjList, DatabaseMemberQ[testObjList]];
		EraseObject[existingObjs, Force -> True, Verbose -> False];
]

